import React from 'react';
const ArticlesList = () => {
    const getArticles = async() => {
        const result = await fetch(`/api/articles-main/all`);
        const res = await result.json()
        return res
        
    }
    const result = getArticles()
    return(
        <React.Fragment>
            <h1>Pages</h1>
            {result && result.then(data => data.map((article, key) => (
                <div key={key}>
                    <p>{article.name}</p>
                    <p>{article.votes}</p>
                </div>
            )))}
            

        </React.Fragment>
    )
}

export default ArticlesList;
